import React,{useState, useEffect} from"react"
import axios from "axios";
import { useParams } from 'react-router-dom';

export default function UpdateVehicle() {
    const { id } = useParams();

    const [vehicle, setVehicles] = useState({});

    const getVehicle = async () => {
        try {
          const response = await axios.get(`http://localhost:6060/vehicle/get/${id}`);
          setVehicles(response.data);
        } catch (error) {
          console.error(error);
        }
      };
      
    getVehicle();
    
 

    const [txtBrand, setBrand] = useState('');
    const [txtModel, setModel] = useState('');
    const [txtType, setType] = useState('');
    const [txtYear, setYear] = useState('');
    const [txtFeatures, setFeatures] = useState('');
    const [txtFuelType, setFuelType] = useState('');
    const [txtPricePerDay, setPricePerDay] = useState('');
    const [txtReg,setReg]=useState('');
    const [txtTransmission,setTrans]=useState('');
    const [txtAvai,setAvai]=useState('');
    const [fileImage, setImage] = useState(); 
  
    function sendData(e) {
      e.preventDefault();
  
      if (!txtBrand || !txtModel || !txtType || !txtYear || !txtFeatures || !txtFuelType || !txtPricePerDay || !fileImage) {
        alert("Please fill in all fields and select an image.");
        return;
      }
      
      const formData = new FormData();
      formData.append('image', fileImage); // Updated
      formData.append('brand', txtBrand);
      formData.append('model', txtModel);
      formData.append('year', txtYear);
      formData.append('type', txtType);
      formData.append('fueltype', txtFuelType);
      formData.append('features', txtFeatures);
      formData.append('priceperday', txtPricePerDay);
      formData.append('transmission', txtTransmission);
      formData.append('regnumber', txtReg);
      formData.append('available', txtAvai);
  
      console.log(formData);
  
      axios.post(`http://localhost:6060/Vehicle/update${id}`, formData)
        .then(() => {
          alert("Vehicle added successfully");
          
        })
        .catch((err) => {
          alert("Vehicle not added: " + err);
        
        });
    }
   
    return(
        <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: 'auto', backgroundColor: '#f0f0f0' }}>
            <h1 style={{color:"#808080"}}>update vehicle id: {id}</h1>
        <form style={{marginLeft:'80px',marginTop:'40px', backgroundColor:'#808080',padding: '20px',width:'50%'}} onSubmit={sendData} >
        <div>
            {/* Brand, Model, and Year */}

            {vehicle.map((v, index) => (
            <div style={{ display: 'flex', gap: '30px', marginBottom: '30px' }}>
                <div>
                <label style={{ color: 'black' }}>Brand: </label>
                <select style={{ background: 'white' }} class="form-control" value={v.brand} name="Brand" id="txtBrand"  onChange={(e) => {
                    setBrand(e.target.value);
                }}>
                    <option value="volvo">Volvo</option>
                    <option value="saab">Saab</option>
                    <option value="mercedes">Mercedes</option>
                    <option value="audi">Audi</option>
                </select>
                </div>
                <div>
                <label style={{ color: 'black' }}>Model:</label>
                <input type="text" style={{ background: 'white' }} value={v.model} class="form-control" id="txtModel"  onChange={(e) => {
                    setModel(e.target.value);
                }} />
                </div>
                <div>
                <label style={{ color: 'black' }}>Year:</label>
                <input type="text" class="form-control" style={{ background: 'white' }} value={v.year}  id="txtYear" onChange={(e) => {
                    setYear(e.target.value);
                }} />
                </div>
            </div>
            ))}


            {/* Type, Transmission, and Availability */}
            {vehicle.map((v, index) => (
            <div style={{ display: 'flex', gap: '30px', marginBottom: '30px' }}>
                <div>
                <label style={{ color: 'black' }}>Type:</label>
                <select style={{ background: 'white' }} name="Type" value={v.type} class="form-control"  id="txtType" onChange={(e) => {
                    setType(e.target.value);
                }}>
                    <option value="suv">SUV</option>
                    <option value="sport">Sport</option>
                    <option value="luxury">Luxury</option>
                </select>
                </div>
                <div>
                <label style={{ color: 'black' }}>Transmission:</label>
                <select style={{ background: 'white' }} name="Transmission" value={v.transmission} class="form-control"  id="txtTransmission" onChange={(e) => {
                    setTrans(e.target.value);
                }}>
                    <option value="Auto">Auto</option>
                    <option value="Manual">Manual</option>
                </select>
                </div>
                <div>
                <label style={{ color: 'black' }}>Availability:</label>
                <select style={{ background: 'white' }} name="Availability" value={v.available} class="form-control"  id="txtAvai" onChange={(e) => {
                    setAvai(e.target.value);
                }}>
                    <option value="rent">Available</option>
                    <option value="free">Unavailable</option>
                </select>
                </div>
            </div>
            ))}
            {/* Fuel Type, Seats, and Price Per Day */}
            {vehicle.map((v, index) => (
            <div style={{ display: 'flex', gap: '30px', marginBottom: '30px' }}>
                <div>
                <label style={{ color: 'black' }}>Fuel Type:</label>
                <select style={{ background: 'white' }} name="FuelType" value={v.fueltype} class="form-control"  id="txtFuelType"  onChange={(e) => {
                    setFuelType(e.target.value);
                }}>
                    <option value="petrol">Petrol</option>
                    <option value="diesel">Diesel</option>
                    <option value="electric">Electric</option>
                </select>
                </div>
                <div>
                <label style={{ color: 'black' }}>Seats:</label>
                <input type="text" class="form-control" style={{ background: 'white' }} value={v.features} id="txtFeatures"  onChange={(e) => {
                    setFeatures(e.target.value);
                }} />
                </div>
                <div>
                <label style={{ color: 'black' }}>Price Per Day:</label>
                <input type="text" class="form-control" style={{ background: 'white' }} value={v.priceperday} id="txtPricePerDay"  onChange={(e) => {
                    setPricePerDay(e.target.value);
                }} />
                </div>
            </div>
            ))}

            {/* Image upload */}
            {vehicle.map((v, index) => (
            <div style={{ display: 'flex', gap: '30px', marginBottom: '30px' }}>
            <div>
                <label style={{ color: 'black' }}>Reg-No:</label>
                <input type="text" class="form-control" style={{ background: 'white' }} value={v.regnumber} id="txtReg"  onChange={(e) => {
                    setReg(e.target.value);
                }} />
                </div>
                <div>
                <label style={{ color: 'black' }}>Image:</label>
                <input type="file" style={{ background: 'white' }} class="form-control" value={v.image} id="fileImage" onChange={(e) => {
                    const selectedFile = e.target.files[0];
                    setImage(selectedFile);
                }} />
                </div>
            </div>
            ))}
            {/* Submit button */}
            <div style={{ display: 'flex', gap: '30px', marginBottom: '30px' }}>
                <button type="submit" class="btn btn-primary mb-3" id="submit">Submit</button>
            </div>
            
            </div>
        </form>
        </div>

    )
}
